3fd2ce68f5b3560","unitId":null,"active":true,"displayGroup":"26ffc18f14f73cf471d0c03e5d4d7749","price":[{"currencyId":"b7d2554b0ce847cd82f3ac9bd1c0dfca","net":368.90756302521,"gross":439,"linked":true,"listPrice":null,"percentage":null,"regulationPrice":null,"extensions":[],"apiAlias":"price"}],"manufacturerNumber":null,"ean":"7433607155126","sales":0,"productNumber":"SW10000","stock":1,"availableStock":1,"available":true,"deliveryTimeId":"551e3ee71b16439991398211d8ceab6e","deliveryTime":null,"restockTime":null,"isCloseout":false,"purchaseSteps":1,"maxPurchase":null,"minPurchase":1,"purchaseUnit":null,"referenceUnit":null,"shippingFree":true,"purchasePrices":[{"currencyId":"b7d2554b0ce847cd82f3ac9bd1c0dfca","net":0,"gross":0,"linked":true,"listPrice":null,"percentage":null,"regulationPrice":null,"extensions":[],"apiAlias":"price"}],"markAsTopseller":null,"weight":null,"width":null,"height":null,"length":null,"releaseDate":null,"categoryTree":["a74cfacc8ce2416f8ee843ccc931c3fe"],"streamIds":null,"optionIds":null,"propertyIds":null,"name":"Fit Ocean Magic Glide Aqua 10\u00b48 - 325x81x15cm","keywords":null,"description":"\n<p><strong><\/strong><\/p>\n<p>Das MAGIC GLIDE ist das Brett, mit dem alles begann. Mit Tausenden von verkauften Boards haben wir das perfekte Familienspa\u00df-Board. Stabil f\u00fcr Anf\u00e4nger, volumin\u00f6s f\u00fcr die ganze Familie und schnell f\u00fcr Fortgeschrittene auf Touren. Der Allround-Shape funktioniert auf Seen, Meeren und Fl\u00fcssen. Zusammen mit einer guten Pumpe und einem guten Rucksack sind Sie startklar!<\/p><p>Das 81cm (32\") breite Board ist super stabil. Das \"magische Gleiten\" kommt von der flachen Nose (das Board ist nicht zu stark aufgebogen) in Kombination mit einem breiten Vorderteil (Nose). Im Gegensatz zu anderen Marken mit spitzen Nasen, die wackelig sind.<br>Wenn Sie fortgeschrittener sind, werden Sie das \"Magic Gliding\" zu sch\u00e4tzen wissen, denn es ist einfach, \u00fcber l\u00e4ngere Strecken in einer geraden Linie zu paddeln. Es erlaubt Geschwindigkeiten bis zu 8 km\/h, was f\u00fcr ein Brett dieser L\u00e4nge sehr gut ist.<\/p><p>Spezifikationen:<br>L\u00e4nge: 325 cm (10'8\u2033)<br>Breite: 81 cm (32\u2033)<br>Dicke: 15 cm (6\")<br>Gewicht: 9 kg<br>Volumen: 300 Liter.<\/p><p>Merkmale:<br>Gro\u00dfes EVA-Deckpad, Bungee-Kordeln f\u00fcr den Transport einer Tasche oder eines Boards, Leash-Ring, gepolsterter Transportgriff<br>Ausgestattet mit einer robusten Slidefinne (leicht abnehmbare Finne) + 2 festen Polyurethan-Seitenfinnen<br>Neuer Rucksack mit extra gepolsterten Tr\u00e4gern f\u00fcr mehr Komfort. XL-Gr\u00f6\u00dfe, so dass der Rucksack f\u00fcr Board + Paddel und Pumpe geeignet ist<br>Beste Qualit\u00e4t auf dem Markt mit einer 3-Jahres-Garantie (engineered to last, engineered in Switzerland<\/p><p><br>Geeignet f\u00fcr:<br>F\u00fcr Anf\u00e4nger bis zu 100 kg. F\u00fcr Fortgeschrittene bis zu 120 kg. Maximale Belastbarkeit 290 kg. (ausreichend f\u00fcr 2 Erwachsene oder 1 Erwachsener + 2 Kinder, wenn gleichm\u00e4\u00dfig verteilt)<br>F\u00fcr M\u00e4nner UND Frauen dank der perfekten Gr\u00f6\u00dfenanpassung<br>Brett, auf dem man leicht Stand Up Paddle lernen kann<br>F\u00fcr Seen, Wellen und Fl\u00fcsse dank einer Allround-Form<br>M\u00f6glichkeit, einen Kajaksitz zu befestigen (Ringe sind vorinstalliert)<\/p><p>Zum Lieferumfang geh\u00f6ren: <br>Board. eine Double-Action-Pumpe (pumpt 2 x schneller und leichter), XL-Rucksack, Flossen, Pflegeset, Schutzstreifen-Flossenbox, englische und deutsche Anleitung (wasserfestes Papier) + kostenlose Leash<\/p><p><br>Was ist der Unterschied zu billigeren Marken?<\/p><p>Die FIT OCEAN Boards haben eine dickere Fusionshaut, hochwertige Dropstichn\u00e4hte und doppellagige Rails, was sie robuster und steifer macht und die Stabilit\u00e4t und Geschwindigkeit erh\u00f6ht<br>Papierverpackung zur Reduzierung von Plastik<br>Kleine Verpackungsma\u00dfe 85x40x20cm<br>Was die Steifigkeit angeht, ist das Fit Ocean dem Naish (https:\/\/forum.surf-magazin.de) deutlich \u00fcberlegen.<\/p><p><br><\/p>\n\n<blockquote><p><\/p><\/blockquote>\n\n","metaDescription":null,"metaTitle":null,"packUnit":null,"packUnitPlural":null,"variantRestrictions":null,"configuratorGroupConfig":null,"mainVariantId":null,"variation":[],"tax":{"taxRate":19,"name":"Standard rate","position":1,"products":null,"rules":null,"shippingMethods":null,"_uniqueIdentifier":"31249d3e7d2a46839f0e126f40c4a44f","versionId":null,"translated":[],"createdAt":"2022-03-03T06:23:16.660+00:00","updatedAt":"2022-09-12T08:53:28.818+00:00","extensions":{"foreignKeys":{"apiAlias":null,"extensions":[]},"internal_mapping_storage":{"apiAlias":null,"extensions":[]}},"id":"31249d3e7d2a46839f0e126f40c4a44f","customFields":null,"apiAlias":"tax"},"manufacturer":null,"unit":null,"prices":[],"cheapestPrice":{"hasRange":false,"variantId":"bf8edd6822934465b7d73c39f100fcf0","parentId":"bf8edd6822934465b7d73c39f100fcf0","ruleId":null,"purchase":null,"reference":null,"unitId":null,"price":[{"currencyId":"b7d2554b0ce847cd82f3ac9bd1c0dfca","net":368.90756302521,"gross":439,"linked":true,"listPrice":null,"percentage":null,"regulationPrice":null,"extensions":[],"apiAlias":"price"}],"extensions":[],"apiAlias":"shopware_core_content_product_data_abstraction_layer_cheapest_price_cheapest_price"},"cover":null,"parent":null,"children":null,"media":null,"cmsPageId":null,"cmsPage":null,"slotConfig":null,"searchKeywords":null,"translations":null,"categories":null,"customFieldSets":null,"tags":null,"properties":null,"options":null,"configuratorSettings":null,"categoriesRo":null,"coverId":"85ad777c80884cd59a40b255fbc5b890","blacklistIds":null,"whitelistIds":null,"visibilities":null,"tagIds":["6ea74546fb9444db8b0e5fb676857de2"],"categoryIds":["a74cfacc8ce2416f8ee843ccc931c3fe"],"productReviews":null,"ratingAverage":null,"mainCategories":null,"seoUrls":null,"orderLineItems":null,"crossSellings":null,"crossSellingAssignedProducts":null,"featureSetId":"7c79e74998e8419ebef9